import React from "react";
import './Login.css';
import AuthContextComponent from '../../contexts/AuthContext';


const context = React.useContext(AuthoContextComponent.Authc);
const Login = () => {
        return (
            <AuthContextComponent>
                { console.log() }
                <div className="container-login">
                <div className="login">
                    <form className="form">
                        <h2 className="titre">Authentification </h2>
                        <div className="form-group">
                            <input className="form-controle" type="email" placeholder="votre Mail" />
                        </div>
                        <div className="form-group">
                            <input className="form-controle" type="password" placeholder="votre mot de pass" />
                        </div>
                        <div className="form-group">
                                <button type="submit" > Login </button>
                        </div>
                    </form>
                </div>
                </div>
            </AuthContextComponent>
        )
    }

export default Login
